import React, { useState, useEffect } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";
import { useLocalState } from "../util/useLocalStroge";

const DeleteUser = () => {
  const [userData, setUserData] = useState([]);
  const [loading, setLoading] = useState(true);
  const { id } = useParams();

  useEffect(() => {
    axios
      .get(`/user/${id}`)
      .then((response) => {
        setUserData(response.data);
        setLoading(false);
        console.log(response.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  const Loading = () => {
    return (
      <>
        <h1>Loading...</h1>
      </>
    );
  };

  const ShowUser = () => {
    return (
      <div className="card mt-5">
        <div className="card-body">
          <h5 className="card-title">{userData.firstName} {userData.lastName}</h5>
          <h6 className="card-subtitle mb-2 text-muted">Username:<strong></strong> {userData.username}</h6>
          <h6 className="card-subtitle mb-2 text-muted">{userData.email}</h6>
          <a href="#" className="card-link">
            Card link
          </a>
          <a href="#" className="card-link">
            Another link
          </a>
        </div>
      </div>
    );
  };

  return <>{loading ? <Loading /> : <ShowUser />}</>;
};

export default DeleteUser;
